import "./About.css";

function About () {
    return (
        <>
            <div className="about__page">
                <h2 className="about-title">About Us</h2>
                <p className="about-content">The hare sits on the grass on the right side of the frame and looks into the lens. The foreground and background are heavily blurred. There are many other pets you may be interested in, just contact us for more informations. From our retail stores and grooming salons, to First Opinion vet surgeries and our range of subscriptions, we provide everything pet owners need to ensure their pet leads a happy and healthy life.</p>
            </div>
        </>
    )
}

export default About;
